import GET_COUNTRIES from '../actions'

const initialState = {
  countries: []
}

export default function(state = initialState, action) {
  switch(action.type) {
    case GET_COUNTRIES:
      return {
        ...state,
        countries: action.payload
      }
  }
  return state
}
